const ClassItem = (props) => {
  let classCode =
    props.item.college + " " + props.item.department + " " + props.item.number;
  return (
    <div className="bg-white p-5 shadow-xl border border-gray-200">
      <div>
        <span className="">{classCode}</span>
        <span className="">{props.item.title}</span>
      </div>
    </div>
  );
};

export default ClassItem;
